import React from 'react';
import ReactDOM from "react-dom"
import { BrowserRouter } from "react-router-dom"
import App from "./App"
// import Home from "./Home"
// import Navbar from "./Navbar"
// import Projects from "./Projects"
import "./styles.css"


ReactDOM.render(
    <BrowserRouter>
        <App />
    </BrowserRouter>,
    document.getElementById("root")
)
